import React from "react";

export default function Data() {
  return (
    <div className="home--data">
      <h1 className="home--title">Ujjwal Kasera</h1>
      <h3 className="home--subtitle">Software Engineer</h3>
      <p className="home--description">
      A skilled software engineer with a passion for creating robust solutions using contemporary technologies. Continuously motivated to expand knowledge and expertise, they have a proven track record of contributing to diverse real-life projects.
      </p>
      <a href="#contact" className="button button-flex">
        Say hello
        <i class="uil uil-message"></i>
      </a>
    </div>
  );
}
